    return(
        <div className="main-container">
       <div className="container">
            <h4>Tongariro Cinemas is the oldest chain of multiplexes in New Zealand
          We're committed to showing the best movies in the world.We have 4 theatres in our complex and screen old classics in 2 theatres and new releases in the other 2.</h4>
	    </div>

	 <div className="main">
	        <div className="container">
	            
                      <h3>Our Contact Details</h3>
                      <h4> Address:-13B, Queen;s street, Newtown, Wellington</h4>
	                  <h4>  Email:tongariro_c@gmailcom</h4>
	                  <h4>Phone numbers-+64 22 314 4223; +64 21 333 7890</h4>
           </div>

     </div>
  </div>
            
                    
);
}
               
	        
		

export default AboutAlt;
